css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("www.youtube.com") {
body {
    background: url("http://i71.fastpic.ru/big/2015/0704/3d/1b7799425e23081700fd525f06a49d3d.jpg");
    background-attachment:fixed
}
#masthead-appbar {
    background-color: rgba(3, 3, 3, 0.26);
    border-bottom: 0px solid #E8E8E8;
}
#appbar-nav .yt-uix-button.yt-uix-button-epic-nav-item {
    line-height: 40px;
    font-weight: normal;
    color: #fff;
}    
epic-nav-item {
    line-height: 40px;
    font-weight: normal;
    color: #000;
}
toggled, .epic-nav-item-heading {
    color: #36B100;
    font-weight: bold;
}
.yt-card {
    opacity: 0.8;
}  
#yt-masthead #logo-container .logo {
    background: transparent url("http://i70.fastpic.ru/big/2015/0704/31/627e06039c81185f4b3b8e2656311631.png") no-repeat scroll -66px -329px;
    width: 80px;
    height: 35px;
}
#yt-masthead-container {
    background: rgba(3, 3, 3, 0.26) none repeat scroll 0% 0%;
    border-bottom: 1px solid #E8E8E8; 
}
}
